import React, { Component } from "react";
import Grid from "@material-ui/core/Grid";
import Fade from "react-reveal/Fade";

class ContactPage extends Component {
  componentDidMount() {
    window.scrollTo(0, 0);
  }

  render() {
    return (
      <div>
        <Fade down>
          <div className="white1 underline">
            {" "}
            Contact Me<a />{" "}
          </div>
        </Fade>
        <Grid container direction="row" justify="center" alignItems="stretch">
          <Grid item xs={12} sm={6} md={6}>
            <Fade left>
              <div className="black3">Email</div>
              <p className="section">
                You can email and reach me at howechyang@gmail.com
              </p>
            </Fade>
          </Grid>
          <Grid item xs={12} sm={6} md={6}>
            <Fade left>
              <div className="black3">Github</div>
              <p className="section">
                Feel free to visit me at my github at
                https://github.com/howeyang
              </p>
            </Fade>
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default ContactPage;
